import './Navigation.css'

const Navigation = () => {
  return (
  <div>
      <nav>
          <h1 class='title'>josh</h1>
          <ul class='navigation-links'>
              <li>work</li>
              <li>about</li>
          </ul>
      </nav>
  </div>
  );
};

export default Navigation;
